import { useEffect, useState } from "react";

const Chatbot = () => {
  const [chatbotData, setChatbotData] = useState(null);

  useEffect(() => {
    fetch("/data/Chatbot.json") // Adjust path if needed
      .then((response) => response.json())
      .then((data) => setChatbotData(data))
      .catch((error) => console.error("Error loading chatbot JSON:", error));
  }, []);

  if (!chatbotData) return <div>Loading chatbot...</div>;

  return <div>Chatbot loaded successfully!</div>;
};

export default Chatbot;
